import React from "react"

function About() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        Name: Isaiah Mitchell I'm 25 years old, born and raised in Northern California. Software Engineer and Producer.
      </p>
    </section>
  )
}

export default About
